import React, { Component } from 'react';
import Axios from 'axios';

export class FirstPg extends Component {

    constructor(props) {
        super(props)

        this.state = {
            playersInfo: []
        }
    }

    componentDidMount() {

        Axios.get("https://api.npoint.io/d6bd0efc05639084eb17/")
        .then(response => {
            // console.log(response.data);

            let modifiedState = this.state;
            modifiedState.playersInfo = response.data.playerList;

            console.log(modifiedState.playersInfo);

            this.setState(modifiedState);
        })
        .catch(error => {
            console.log(error);
        });
    }

    render() {
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col-md-4 card'>
                        <img className="card-img-top" src={require('./images/63706.jpg').default} alt="Card image"/>
                        <div className="card-body">
                            <h4 className="card-title">John Doe</h4>
                            <p className="card-text">Some example text.</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default FirstPg
